import React, {useState} from 'react';
import {TextField, Button, Typography, Paper } from '@material-ui/core';
import useStyles from './styles';
const Form = ()=>{

    const {postData, setPostData} = useState({
        creator:'',
        title:'',
        message:'',
        tags:'',
        selectedFile:'',
    });

    const classes = useStyles();

    const handleSubmit = ()=>{

    }

    return(
       <Paper className={classes.paper}>
            <form autoComplete="off" noValidate className={classes.form} onSubmit={handleSubmit}>
                <Typography varient="h6">Creating A Memory</Typography>
                <TextField name="creator" varient="outlined" label="Creator" fullWidth value={postData.creator} onChange={(e)=>setPostData({...postData,creator:e.target.value})} />
                <TextField name="title" varient="outlined" label="Title" fullWidth value={postData.creator} onChange={(e)=>setPostData({...postData,creator:e.target.value})} />
                <TextField name="message" varient="outlined" label="Creator" fullWidth value={postData.creator} onChange={(e)=>setPostData({...postData,creator:e.target.value})} />
                <TextField name="tags" varient="outlined" label="Creator" fullWidth value={postData.creator} onChange={(e)=>setPostData({...postData,creator:e.target.value})} />
            </form>
        
       </Paper>
    );
}

export default Form;
